    decorrelation(ps, Rbuf, Lbuf, is34);

    stereo_processing(ps, Lbuf, Rbuf, is34);

    hybrid_synthesis(L, Lbuf, is34, len);

    hybrid_synthesis(R, Rbuf, is34, len);



    return 0;

}

