    uint64_t size= (uint64_t)st->codec->extradata_size + atom.size + 8 + FF_INPUT_BUFFER_PADDING_SIZE;

    uint8_t *buf;

    if(size > INT_MAX || (uint64_t)atom.size > INT_MAX)

